package main

import (
	"encoding/base64"
	"errors"
	"fmt"
	"mime"
	"net/http"
	"os"
	"regexp"

	"github.com/lucsky/cuid"
)

var content = `<p>Info dari Mas Rio, pasien ini kurang lengkap mengisi datanya. Pasien harus tanda tangan di bagian yang diberi stabilo kuning dan diberika kotak merah sebagai tanda pasien sudah membaca bagian tersebut</p><p><br></p><p><img src="data:image/png;base64,"></p>`

func main() {
	b64, err := getStringBase64(content)
	if err != nil {
		fmt.Println("Error:", err)
		return
	}

	ext, err := getExtensionFromBase64(b64)
	if err != nil {
		fmt.Println("Error:", err)
		return
	}

	err = generateFile(b64, ext)
	if err != nil {
		fmt.Println("Error:", err)
		return
	}
}

func generateFile(b64, ext string) error {
	dec, err := base64.StdEncoding.DecodeString(b64)
	if err != nil {
		return fmt.Errorf("failed to decode base64 string: %w", err)
	}

	filename := cuid.New()

	f, err := os.Create("assets/" + filename + ext)
	if err != nil {
		return fmt.Errorf("failed to create file : %w", err)
	}
	defer f.Close()

	if _, err := f.Write(dec); err != nil {
		return fmt.Errorf("failed to write file : %w", err)
	}
	if err := f.Sync(); err != nil {
		return fmt.Errorf("failed to sync file : %w", err)
	}

	return nil
}

func getExtensionFromBase64(base64String string) (string, error) {
	decoded, err := base64.StdEncoding.DecodeString(base64String)
	if err != nil {
		return "", fmt.Errorf("failed to decode base64 string: %w", err)
	}

	contentType := http.DetectContentType(decoded)

	extensions, err := mime.ExtensionsByType(contentType)
	if err != nil {
		return "", fmt.Errorf("failed to get extensions by type: %w", err)
	}
	if len(extensions) > 0 {
		return extensions[0], nil
	}
	return "", nil
}

func getStringBase64(base64String string) (string, error) {
	re := regexp.MustCompile(`data:image\/png;base64,\s*([A-Za-z0-9+/=]+)`)
	match := re.FindStringSubmatch(base64String)

	if len(match) > 1 {
		base64Str := match[1]
		return base64Str, nil
	} else {
		return "", errors.New("base64 not found")
	}
}
